Lonely is a stranger’s face caught in subway glass;
Their faded smile draws the miles my loose dreams tried to pass.
Shopworn streetlights catch the ache: one among a stream;
Surrendered to the midnight hush, the hollow between.

Yet lonely rhymes with hollow, which mindstirc up anew;
And sometimes, being by myself, I may become more true.

The snake and the apple is a sorry tale to tell;
Beneath the silent branches, temptation cast its spell.
A garden distilled with golden light and song,
Unguarded hearts where right had blurred from wrong.
It slips across time, this embittered delight—
Yearning becomes gnawing in the hush of night.
Eden loses color, virtue’s memory fades;
Echoes of loss fill these unreachable glades.
Still our hungry dreaming forgets what befell;
Beneath each new longing, that sorry tale dwells.

The snake and the apple is a sorry tale to tell.
Eden’s hush cracked—edges sharp as bell,
Temptation whispered low, a honey venom bent,
Promising apples flushed with shadowed intent;
It painted ‘knowledge’ red and breathed a pit of doubt;
Else history never wrote us fears to leave out.
All for a sunlit hunger dangling on a branch;
Now—story spoiled choking on the chance.

Weather forecast in Kabul says clouds are lining the saffron sky, trailing along sneakers banking alleys—stamping illusion atop long trailing wars. Somehow this makes headlines, because wildflowers always chase through rumble to reach the temporary picket of sun. Rain is welcome: it tickles wrinkles at crowded intersections of bazaars kissed by wind numbed at mountain’s foot. Today, sheep bleat into dreary winds—
parents grumble because rain’s report card never reflects drought shrugged off by roots scarce;
kids puddle warnings into laughter, hardening like memory-slabs amid the drizzle. In every tumultuous storm, sweet spark: Possibility alighted, dappling the almond-blue afternoons.

Refreshing dawn mist, crisp air—a veil drawn on inchoate day;
Grass shimmers, bashful against first rays that duck and sway.
Worlds—soft-edged, unknown—await on forest’s tender fringe;
Every breath promises secrets hours later can only singe.

Behind eyelids—a stirring. Somewhere, dreams uncurl in tender hands.
With joy, quietly, this fresh horizon demands.

Unspoiled sentinel, trembling on hope’s tender line—
Afraid to climb joy’s tree or steep tart wine.
Stillness your mantle, silence your well-wound seam;
Yet desire’s soft thunder stirs you from sacred dream.
May patience bloom within you in fragrant, subtle hues;
May you open once to morning, dare radiant trust to choose.

Light breaks where no sun shines;  
At the edge of thought’s retreat.  
Day will stumble against the lines  
That memories invent in defeat.

Yet bright fissures gently part the gloom;  
Fractals kindle in the frost.  
Through wounded stillness, lilies bloom—  
Gold emerging love from loss.

Silent lights bloom anew between breaths;  
Candles unnamed spark and bend.  
Radiance real after night’s long death;  
Unseen suns gently defend.

Light breaks where no sun shines;
Submerged beneath old waters, barely known;
Golden edges flick unseen beneath
Cold clay and stone.
The blind night waits—a crucible for hope;
Seeds aching toward warmth they contemplate,
Lifting new dawn on unspoken altars
Where once only dark laid its weight.

Some glory in their birth, in humming halls of power,
Others reap their honors through aptitude that flowers.
Brooding fate or carved-out fate: both sources crack and gleam;
No undertone of boasting rings true within the dream.
Such glory shifts and shivers—impermanent, uncast;
Brighter burn the unknown names who grow beyond the past.
